webstoreListingDescription.message:
Zainstaluj rozszerzenie AudD i kliknij jego ikonę, aby zidentyfikować utwór odtwarzany na bieżącej karcie.
Obejrzyj powyższy film, aby zobaczyć, jak to działa.

Rozszerzenie AudiD:
- Rozpoznaje muzykę odtwarzaną w przeglądarce;
- Znajduje muzykę w bazie danych AudD z ponad 75 milionami utworów przy użyciu technologii rozpoznawania muzyki;
- Pokazuje teksty dla zidentyfikowanych piosenek;
- Pokazuje linki do słuchania utworów w Apple Music, Spotify, Deezer, YouTube Music;
- Wyświetla dokładny moment w rozpoznanej piosence, gdy odtwarzany jest dźwięk z przeglądarki.

API rozpoznawania muzyki: https://audd.io
Kod źródłowy: https://github.com/AudDMusic/chrome-extension

Rozszerzenie obsługiwane przez interfejs API rozpoznawania muzyki AudD®

